import React from 'react';

const HomePage =()=>{
  return (
    <div>
      <p></p>I'm a full-stack software engineer with 4+ years of hands-on professional experience in software development, process improvement, on-time delivery of projects, with strong front-end and backend development experience. Self-motivated & committed individual who loves challenges, quick to learn, and appreciates feedback.
I'm currently at TalentUp Africa, leading the backend team that's building a recruitment software to enable a more efficient, objective, easier and faster way of recruiting quality talent.
I previously worked at Voyage Control, where I owned the end-to-end development of the ports section of the logistics management solution to bring down time spent by a truck at the ports to below 1 hour.
If you ever want to chat about or play basketball, or discuss an interesting project, please feel free to hit me up.
    </div>
  )
}

export default HomePage;
